import React from 'react';
import { Link } from 'react-router-dom'; // Import Link from React Router

const ButtonSignIn = () => {
  return (
    <div className='xl:max-w-[1280px] w-full h-full'>
      <div className=''>
        <button className='outline bg-transparent text-orange hover:bg-orange font-bold py-2 px-7 border-b-1 border-orange hover:text-white outline-orange rounded'>
          Sign In
        </button>
      </div>
    </div>
  );
};

export default ButtonSignIn;
